result:
query ($page: Int) {
  posts:allStrapiPost(perPage: 2, page: $page) @paginate {
    pageInfo {
      totalPages
      currentPage
    }
    edges{ 
      node{
        id,
        title,
        created_at,
        content,
        tags{
          id,
          title
        }
      }
    }
  }

 general:allStrapiGeneral{
    edges{
      node{
        id,
        title,
        subTitle,
        cover{
          url
        }
      }
    }
  }
}
